import './App.css';

export function App() {
  return (
    <>
      {visible && <Header />}
      <main>
        <NavTabs active={nav} onChange={(current) => setNav(current)}/>

        {nav === 'main' && <VideoList/>} {/*Если nav равняется main то будет VideoList*/}

        {nav === 'profile' && <Profile/>}

        {nav === 'feedback' && <Feedback/>}

        {nav === 'effect' && <Effect/>}

        {nav === 'userList' && <UserList/>}
      </main>
    </>
  );
}


export default App;
